import cardData from '../data/card_data.json';
import Card from './Card';
import './CardList.css'

export default function CardList() {
    return (
        <div className="card-list">
            {cardData.map((item, index) => (
                <Card 
                    key={index}
                    imageUrl={item.image_url}
                    rating={item.rating}
                    reviews={item.reviews}
                    time={item.time}
                    title={item.title}
                    price={item.price}
                />
            ))}
        </div>
    );
}
